import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import GroupContext from './Context/GroupContext';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <GroupContext>
    <App />
  </GroupContext>
);
